import Grid from "@mui/material/Grid";
import SuiBox from "components/SuiBox";
import SuiTypography from "components/SuiTypography";
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
// import Footer from "examples/Footer";
import Card from "@mui/material/Card";
import 'bootstrap/dist/css/bootstrap.min.css';
import SuiButton from "components/SuiButton";
// import { Link } from "react-router-dom";
import Checkbox from "@mui/material/Checkbox";
import PropTypes from "prop-types";
import SuiSelect from "components/SuiSelect";
import DataTable from "examples/Tables/DataTable";
import mfdatatable from "layouts/ecommerce/referral/data/mfdatatable";
import mftable1 from "layouts/ecommerce/referral/data/mftable1";
import mftable from "layouts/ecommerce/referral/data/mftable";

function IdCell({ id, checked }) {

  IdCell.defaultProps = {
    checked: false,
  };

  // Typechecking props for the IdCell
  IdCell.propTypes = {
    id: PropTypes.string.isRequired,
    checked: PropTypes.bool,
  };

  const passwordRequirements = [

  ];

  const renderPasswordRequirements = passwordRequirements.map((item, key) => {
    const itemKey = `element-${key}`;

    return (

      <SuiBox key={itemKey} component="li" color="text" fontSize="1.25rem" lineHeight={1}>
        <SuiTypography
          variant="button"
          textColor="text"
          fontWeight="regular"
          verticalAlign="middle"
        >
          {item}
        </SuiTypography>
      </SuiBox>
    );
  });

  return (

    <DashboardLayout>
      <DashboardNavbar />
      <SuiBox p={1} >
        <Card id="profile">
          <SuiBox p={3}>
            <Grid container spacing={3} alignItems="center">
              <Grid item>
                <SuiBox height="100%" mt={0.5} lineHeight={1}>
                  <SuiTypography variant="h3" fontWeight="medium" >
                    MF Holdings
                  </SuiTypography>
                </SuiBox>
              </Grid>
            </Grid>
          </SuiBox>
        </Card>
      </SuiBox>

      <SuiBox p={1}>
        <Card id="change-password">

          <SuiBox display="flex" justifyContent="space-between" alignItems="flex-end" flexWrap="wrap">
            <SuiBox component="ul" m={0} pl={3.25} mb={{ xs: 8, sm: 0 }}>
              {renderPasswordRequirements}
            </SuiBox>

          </SuiBox>

          <SuiBox component="form" pb={3} px={3} p={3} >

            <Grid container spacing={3}>
              <Grid item xs={12} >
                <Grid container spacing={2}>

                  <Grid item xs={12} sm={15}>
                    <Grid container spacing={3} >

                      <Grid item xs={12} sm={4} >
                        <SuiBox
                          display="flex"
                          flexDirection="column"
                          justifyContent="flex-end"
                          height="100%"
                        >
                          <SuiBox mb={1} ml={0.5} lineHeight={0} display="inline-block">
                            <SuiTypography
                              component="label"
                              variant="caption"
                              fontWeight="bold"
                              textTransform="capitalize"
                            >
                              Name
                            </SuiTypography>
                          </SuiBox>
                          <SuiSelect
                            placeholder="Select"
                            options={[

                              { value: "Select User", label: "Select User" },
                              // { value: "Purchase", label: "Purchase" },
                              // { value: "Switch In", label: "Switch In" },
                              // { value: "", label: "", isDisabled: true },
                            ]}


                          />
                        </SuiBox>
                      </Grid>

                      <Grid item xs={12} sm={4}>
                        <SuiBox display="flex" alignItems="center" style={{ marginLeft: "50px", marginTop: "40px" }}>

                          <Checkbox defaultChecked={checked} />
                          <SuiBox ml={1}>
                            <SuiTypography variant="caption" fontWeight="medium" textColor="text" >
                              {id}
                            </SuiTypography>
                          </SuiBox>

                          <SuiTypography component="label" variant="h10" fontWeight="bold">
                            Download Excel
                          </SuiTypography>
                        </SuiBox>
                      </Grid>

                      <Grid item xs={12} sm={4}>
                        <SuiBox display="flex" alignItems="center" style={{ marginTop: "40px" }}>

                          <Checkbox defaultChecked={checked} />
                          <SuiBox ml={1}>
                            <SuiTypography variant="caption" fontWeight="medium" textColor="text" >
                              {id}
                            </SuiTypography>
                          </SuiBox>

                          <SuiTypography component="label" variant="h10" fontWeight="bold" >
                           Download Pdf
                          </SuiTypography>
                        </SuiBox>
                      </Grid>

                      <Grid item xs={12} sm={4}>
                        <SuiBox
                          display="flex"
                          flexDirection="column"
                          justifyContent="flex-end"
                          height="100%"
                        >
                          <SuiButton variant="gradient" buttonColor="dark" >
                            Submit
                          </SuiButton>
                        </SuiBox>
                      </Grid>

                    </Grid>
                  </Grid>

                </Grid>
              </Grid>
            </Grid>
          </SuiBox>
        </Card>

      </SuiBox>

      <SuiBox p={1}>
        <Card>
          <SuiBox pt={3} px={3}>
            <SuiTypography variant="h6" fontWeight="medium" >
              PAN Wise Summary
            </SuiTypography>
          </SuiBox>
          <DataTable
            table={mfdatatable}
            entriesPerPage={false}
            showTotalEntries={false}
            isSorted={false}
            noEndBorder
          />
        </Card>
      </SuiBox>

      <SuiBox p={1}>
        <Card>
          <SuiBox pt={3} px={3}>
            <SuiTypography variant="h6" fontWeight="medium">
              Detailed Holding Statement Through PDF(all MF)
            </SuiTypography>
          </SuiBox>
          <DataTable
            table={mftable}
            entriesPerPage={false}
            showTotalEntries={false}
            isSorted={false}
            noEndBorder
          />
        </Card>
      </SuiBox>
      <SuiBox p={1}>
        <Card>
          <SuiBox pt={3} px={3}>
            <SuiTypography variant="h6" fontWeight="medium">
              Detailed Holding Statement Through PDF(all MF)
            </SuiTypography>
          </SuiBox>
          <DataTable
            table={mftable1}
            entriesPerPage={false}
            showTotalEntries={false}
            isSorted={false}
            noEndBorder
          />
        </Card>
      </SuiBox>
    </DashboardLayout>
  );
}

export default IdCell;
